def run(value_list):
    """
    Calculates the increase/decrease in Statutory federal income tax (benefit) from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    # Extract data for 2018 and 2019
    try:
        tax_2018 = next(item for item in value_list if item['header1'] == 'June 2, 2018')['number_value']
        tax_2019 = next(item for item in value_list if item['header1'] == 'June 1, 2019')['number_value']
    except StopIteration:
        return (0.00, "")

    # Calculate the difference
    difference = tax_2019 - tax_2018

    # Determine the scale
    if difference == 0:
        return (0.00, "")
    else:
        return (round(difference, 2), "")

def run(value_list):
    """
    Calculates the change in emissions for Scope 1 (Combustion of fuel and operation of facilities)
    from FY18 to FY19 for UK and Ireland only.

    Args:
        value_list: A list of dictionaries containing financial report data.

    Returns:
        A tuple (number, scale) representing the change in emissions from FY18 to FY19.
    """
    fy18_value = None
    fy19_value = None

    for item in value_list:
        if item['category'] == 'Combustion of fuel and operation of facilities (Scope 1)' and item['header1'] == 'FY18**':
            fy18_value = item['number_value']
        elif item['category'] == 'Combustion of fuel and operation of facilities (Scope 1)' and item['header1'] == 'FY19**':
            fy19_value = item['number_value']

    if fy19_value is not None and fy18_value is not None:
        change = fy19_value - fy18_value
        scale = 'thousand'  # Assuming scale is always thousand
        return (round(change, 2), scale)
    else:
        return (None, None)

