    men_65_2018 = []
    for item in value_list:
        if item['category'] == 'Member aged 65 (current life expectancy)' and item['header2'] == 'Men' and item['header3'] == '2019':
            men_65_2019.append(item['number_value'])
        if item['category'] == 'Member aged 65 (current life expectancy)' and item['header2'] == 'Men' and item['header3'] == '2018':
            men_65_2018.append(item['number_value'])

    if men_65_2018 and men_65_2019:
        average_2018 = sum(men_65_2018) / len(men_65_2018)
        average_2019 = sum(men_65_2019) / len(men_65_2019)
        change = average_2019 - average_2018
        return (round(change, 2), 'thousand')
    else:
        return (0.00, '')

