def run(value_list):
    """
    Calculates the global increase/decrease in Hindi films from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    # Find relevant data for 2018 and 2019 for Hindi films
    hindi_films_2018 = next((item for item in value_list if item['category'] == 'Hindi films' and item['header2'] == '2018'), None)
    hindi_films_2019 = next((item for item in value_list if item['category'] == 'Hindi films' and item['header2'] == '2019'), None)

    if hindi_films_2018 and hindi_films_2019:
        increase_decrease = hindi_films_2019['number_value'] - hindi_films_2018['number_value']

        if increase_decrease > 0:
            scale = 'thousand'
        elif increase_decrease < 0:
            scale = 'thousand'
        else:
            scale = ''

        return (round(increase_decrease, 2), scale)
    else:
        return (0.0, '')

def run(value_list):
    """
