def run(value_list):
    """
    Calculates the change between indirect energy consumption (MWh) in 2018 and 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    year_2018_value = 0
    year_2019_value = 0

    for item in value_list:
        if item['header1'] == '2018' and item['category'] == 'Indirect energy consumption (MWh)':
            year_2018_value = item['number_value']
        elif item['header1'] == '2019' and item['category'] == 'Indirect energy consumption (MWh)':
            year_2019_value = item['number_value']

    change = year_2019_value - year_2018_value

    if change == 0:
        return (0.00, '')

    if change > 0:
        return (round(change, 2), 'thousand')
    else:
        return (round(change, 2), 'thousand')

